const newArr = [];
const single = (arr) => {
    for (var i = 0; i < arr.length; i++) {
        for (var j = 0; j < newArr.length; j++) {
            if (newArr[j] == arr[i]) {
                break;
            }
            if (j == newArr.length) {
                newArr.push(arr[i])
            }
        }
    }
    return newArr
}
module.exports = {
    single
}